      <i className="fa fa-user" />


      <br></br>

      <div className="footerspace"></div>
    </Fragment>
  );
};

Dashboard.propTypes = {
  auth: PropTypes.object.isRequired,
};

const mapStateToProps = (state) => ({
  auth: state.auth,

});

export default connect(mapStateToProps)(Dashboard);
